import React from "react";
import { Containering, Wrappering } from "./NewCrudStyle";

const NewCrudHooks = () => {
  return (
    <Wrappering>
      <Containering>
        <table>
          <thead>
            <tr>
              <td>Id</td>
              <td>Name</td>

              <td>Status</td>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </Containering>
    </Wrappering>
  );
};

export default NewCrudHooks;
